".tooltip[_nghost-%COMP%] {
      display: block;
      pointer-events: none;
    }
    .bs3.tooltip.top[_nghost-%COMP%] > .arrow[_ngcontent-%COMP%] {
      margin-left: -2px;
    }
    .bs3.tooltip.bottom[_nghost-%COMP%] {
      margin-top: 0px;
    }
    .bs3.bs-tooltip-left[_nghost-%COMP%], .bs3.bs-tooltip-right[_nghost-%COMP%]{
      margin: 0px;
    }
    .bs3.bs-tooltip-right[_nghost-%COMP%]   .arrow[_ngcontent-%COMP%], .bs3.bs-tooltip-left[_nghost-%COMP%]   .arrow[_ngcontent-%COMP%] {
      margin: .3rem 0;
    }"
